import React, {Components} from 'react';

export default  class Classbutton extends Component{
    render(){
        return(
            <div>
            <h2> Select A Class</h2>
            <button onClick={this.elf}> Elf </button>
            <button> Human </button>
            <button> Dwarf </button>
            <button> Dragonborn </button>
            </div>
        );
    }
}
